import styled from "styled-components";
import { useState, useEffect } from "react";
import axios from "axios";
import { useAppSelector } from "../../hooks";
import Pagination from "../Pagination";
import RenderContent from "./RenderContent";
import BodyTitle from "./BodyTitle";
import { useNavigate } from "react-router-dom";

function WriteFeedBody() {
  return (
    <BodyContainer>
      <BodyWrapper>
        <h2>함께 할 때 더 즐거운 순간</h2>
        <form>
          <div class="form-group pt-5">
            <label for="title1" class="d-block pt-2">
              <h6>제목</h6>
            </label>
            <input type="email" class="form-control p-1" id="title1" placeholder="제목을 입력해주세요." />
          </div>
          <div class="form-group pt-3">
            <label for="tag1" class="d-block pt-2">
              <h6>태그</h6>
            </label>
            <select class="form-control p-2" id="tag1">
              <option>1</option>
              <option>2</option>
              <option>3</option>
              <option>4</option>
              <option>5</option>
            </select>
          </div>

          <div class="form-group pt-3">
            <label for="content1" class="d-block pt-2">
              <h6>내용</h6>
            </label>
            <textarea class="form-control mh-100" id="content1" rows="8" placeholder="내용을 입력해주세요."></textarea>
          </div>
          <div class="d-grid gap-2 d-md-block mt-4 d-md-flex justify-content-md-end">
            <button type="button" class="btn btn-primary py-2 px-4 me-md-3">
              취소
            </button>
            <button type="button" class="btn btn-primary py-2 px-4">
              등록
            </button>
          </div>
        </form>
      </BodyWrapper>
    </BodyContainer>
  );
}

export default WriteFeedBody;

const BodyContainer = styled.div`
  width: 100%;
`;

const BodyWrapper = styled.div`
  width: 900px;
  margin: auto;
  padding: 30px 0;
`;

const Label = styled.label``;
